02-javascript/0202-modelo-de-datos/.body:
The JavaScript data model
Knowing a programming language basically means that we know its syntax, data model, execution model, and idioms.
Throughout this lesson, you will code into JavaScript what you learned in the prior lesson.
Not all languages allow a 1:1 translation of the concepts we have included in the model. For instance, JavaScript does not feature any mechanisms that allow for the creation of new types, but it does feature other mechanisms that allow for the implementation of a similar functionality.
Experimenting with JavaScript
You are going to be experimenting with JavaScript, so you will need a quick way of inspecting expressions and obtaining feedback on what you are doing. The best way is to use the Node console. For instance:
sh
$ node --use_strict
The option --use_strict enables JavaScript's strict mode, which simplifies some aspects of the language. Strict mode cuts back on some features, but its benefits outweigh its drawbacks.
Now you can try to insert some expressions:
sh
> 40 + 2
42
> var point = { x: 1, y: 1 };
undefined
> point
{ x: 1, y: 1 }
> point.x
1
In order to clear the screen, press ctrl+l. To exit Node, press ctrl+c twice in succession. If Node seems to be unresponsive while typing an expression, press ctrl+c once to cancel the expression.
If you would rather not put up with the Node console, you can always write a program and use console.log() in order to display expressions on screen.
// in file test.js
console.log(40 + 2);
var point = { x: 1, y: 1 };
console.log(point);
console.log('Coordinate X:', point.x);

Now run the program with Node:
sh
$ node test.js
42
{ x: 1, y: 1 }
Coordinate X: 1
This lesson assumes you will be using a single Node console session, unless otherwise specified.
You can keep the same session logged on for most of the examples, but in the case that you find anything unexpected, you should try restarting the console before doing anything else. In order to restart the console, you have to exit and enter again.
It would be best for you to keep this text opened up in a window (or printed out), and the Node console on another.
Primitive types
"Primitive type" is the name give a type that comes built into the language, and which allows for the creation of newer, more complex types. The primitive types in JavaScript are: boolean, number, string, object, and function.
// You can find more possible values for each of the types in the comments.
var bool = true; // false
var number = 1234.5; // 42, -Infinity, +Infinity
var text = 'I want to be a pirate!'; // "I want to be a pirate"
var object = {}; // [], null
var code = function () { return 42; };

You can tell them from others because they respond differently to the typeof operator. Notice how the types are text strings:
typeof true;
typeof 1234.5;
typeof 'I want to be a pirate!';
typeof {};
typeof function () { return 42; };

In JavaScript, it is possible to declare a variable without assigning a value to it. In this case, the variable's type would be 'undefined'.
var x;
typeof x;
x = 5; // as soon as we give it a value, its type will cease to be undefined.
typeof x;

Objects in JavaScript
From among all the types, we shall pay special attention to those whose values allow compositing with other values. These are of the object type.
In JavaScript, objects are collections of tagged values. For instance, if we want to represent the point (10, 15) in the XY plane, we can tag the value on the Y axis with the string 'x', and the value on the Y axis with the 'y' string.
var point = { 'x': 10, 'y': 15 };

Every tag/value pair is called an object property. In a less strict way of speaking, when we discuss an object's properties, we are usually referring to values, while what we usually mean by a property name is a tag.
If property names are written according to the JavaScript identifier forming rules, the quotes are unnecessary and can be skipped.
var point = { x: 10, y: 10 }; // much more convenient.

This is the most frequent case, the recommended one, and the one we shall use throughout this material; however, you should remember that under the hood, the property name is a string.
In order to access a property of an object, we use the brackets [ ] with the property name in between:
point['x'];
point['y'];

Again, if we follow the identifier forming rules, we can use the (much easier to write) dot notation to access the property:
point.x;
point.y;

We use the assignment operator to change the value of a property:
point.x = 0;
point.y = 0;
point['x'] = 0;
point['y'] = 0;

If you access a non-existent property, you will obtain the value undefined:
var label = point.label; // will be undefined. Check it out with typeof.

We can create new properties at any time by assigning a value to them:
point.label = 'origin';
point;

Arrays
Arrays are collections of ordered data.
Consider the command list in a videogame menu:
var menu = ['Attack', 'Defense', 'Inventory'];

In this type of objects, order matters. Accessing the different values is done by using the item's index in the array, between brackets. Indices begin from 0, and not from 1.
menu[0];
menu[1];
menu[2];

We can check an array's length by accessing its length property.
menu.length;

Items can be added to the array's end by calling the push method:
menu.push('Magic');

An item can also be removed from the end by using the pop method:
menu.pop();

An array can be altered (have items added or removed from it) in any place by using the splice method:
// Inspect the list after every operation.
menu = ['Attack', 'Defense', 'Inventory'];
menu.splice(2, 0, 'Magic'); // add Magic before Inventory.
menu.splice(2, 2, 'Ench. Inventory'); // replace Magic and Inventory with Ench. Inventory.
menu.splice(0, 0, 'Wait'); // add Wait to list beginning.

As is the case with objects, we can change any value at any time by using the assignment operator:
menu[0] = 'Special'; // replace Wait with Special

Again, as with objects, we can access a non-existent value and retrieve or assign it at any time:
menu;
menu.length;
var item = menu[10];
typeof item; // will be undefined.
menu[10] = 'Secret';
menu;
menu.length;

If we assign to an index beyond the current length, the array will be extended until that index is included.
Making a distinction between objects and arrays
Both arrays and objects are of the 'object' type, therefore it is necessary to use the Array.isArray() method to tell them apart.
var obj = {}; // the void object is as valid as any other.
var arr = []; // an empty list.
typeof obj; // will be object.
typeof arr; // will be object.
Array.isArray(obj); // will be false.
Array.isArray(arr); // will be true.

null
There is a last possible value for the object type, which is null. This value represents the absence of an object, and it normally has the following uses:

In functions that query about an object, to indicate that the object has not been found.

In compositing relationships, to indicate that the composite object no longer needs the compositing object.


For instance, in an RPG, we can query about the next living enemy in order to check whether the battle has to keep going:
function getNextAliveEnemy() {
  var nextEnemy;
  if (aliveEnemies.length > 0) {
    nextEnemy = aliveEnemies[0];
  }
  else {
    nextEnemy = null;
  }
  return nextEnemy;
}

Or, in another example, consider a hero's character sheet:
var hero = { sword: null, shield: null };
hero.sword = { attack: 20, magic: 5 }; // take a sword.
hero.sword = null; // drop a sword.

Object compositing
Objects and arrays allow any compositing of objects. That is to say, their values can be other objects, arrays, numbers, strings or functions.
The following example shows a possible RPG character sheet:
var hero = {
  name: 'Link',
  life: 100,
  weapon: { kind: 'sword', power: 20, magicPower: 5 },
  defense: { kind: 'shield', power: 5, magicPower: 0 },
  // Inventory in slots. Two empty slots and another with 5 potions.
  inventory: [
    { item: null, count: 0},
    { item: null, count: 0},
    { item: { kind: 'potion', power: 15 }, count: 5}
  ]
};

Some properties:
hero.name; // hero's name
hero.weapon.kind; // type of weapon
hero.inventory[0]; // first inventory slot
hero.inventory[0].item; // what is in the first inventory slot
hero.inventory[2].item.power; // power level of the item in the third inventory slot

Identity of objects
In JavaScript, the equality operator is === (triple equal). This allows us to compare two objects and decide whether they are equal. There is also the inequality operator !==, which compares two objects and decides whether they are not equal.
For the types 'bool', 'string', 'number' & 'undefined', two values are equal if they are of the same shape:
// All of these comparisons are true.
"Hola" === "Hola";
"Hola" !== "hola";
true === true;
123 === 123.0;
123 !== "123";
123 === 122 + 1; // the expression is first solved, then compared.
undefined === undefined;

For the object type, two objects are equal only if they refer to the same object:
({} !== {}); // regardless of the shape, these are two different objects.
({} !== []);
[] !== []; // same as before.
[1, 2, 3] !== [1, 2, 3]; // regardless of the shape, the objects are different.
null === null; // but with null it works, since there is only one null value.
var obj = {};
var sameObj = obj;
var another = {};
sameObj === obj; // it works because both names refer to the same object.
sameObj !== another; // like before, different despite the same shape.

Objects and message passing
JavaScript objects and the ability to use code as a value like any other allow us to codify the concepts of object and message passing from object-oriented programming.
Codifying the state
With everything we have seen until now, you should have enough knowledge to codify the state. The attribute set of the object in the object-oriented model translates into the property set of JavaScript objects.
In the Space Invaders example, the state of enemies comprised of:

Can be codified as:
var enemy = {
  graphic: 'specie01.png',
  currentDirection: 'right',
  position: { x: 10, y: 10 },
  score: 40
};

The foremost limitation to JavaScript is that access to object properties cannot be restricted (i.e., there are no private properties). Because of this, there is nothing to prevent us from directly modifying the position.
enemy.position.x = 100; // perfectly valid.

At most, we could warn the user against code that handles certain properties. A widespread practice in JavaScript is to add an underscore _ to attributes we want to consider to be private:
var enemy = {
  _graphic: 'specie01.png',
  _currentDirection: 'right',
  _position: { x: 10, y: 10 },
  _score: 40
};

However, we stress that this is only a convention, and underscore-marked attributes can be regardless accessed:
enemy._position.x = 100; // also perfectly valid.

Codifying the API
The actions an object's API is comprised of, i.e. its methods, can be implemented as functions inside properties of the object.

var enemy = {
  _graphic: 'specie01.png',
  _currentDirection: 'right',
  _position: { x: 10, y: 10 },
  _score: 40,

  moveLeft: function () { console.log('Going left!'); },
  moveRight: function () { console.log('Going right!'); },
  advance: function () { console.log('Marching forward!'); },
  shoot: function () { console.log('PEW!'); } // (it's a laser)
};

Sending a message to an object simply means accessing the target's property, which will be a function, and calling it.
enemy.shoot(); // first we access with dot, then call with ().
enemy.moveLeft();
enemy.moveLeft();
enemy.advance();
enemy['shoot'](); // it is the same if we access with brackets and call with ().

Any function can behave as a method. In order to have it act as a method, all we need is to call it from an object's property. And, like any other object property, we can change it at any time:
enemy.shoot(); // PEW!
enemy.shoot = function () { console.log('VOIP!'); };
enemy.shoot(); // VOIP!

Now then, notice the following behavior:
enemy; // notice the position.
enemy.moveLeft();
enemy; // notice the position again.

Obviously, from just a glance at what moveLeft does, we would be unable to tell that it changes the state of the message's target object. How can we fix this?
Since any function can behave as a method, what we need is a way of referring to the message's target, if there is one. When used as a method, the target is always stored to the variable this.
Thanks to this variable, we can implement the following movement methods:
enemy.moveLeft = function () { this._position.x -= 2; };
enemy.moveRight = function () { this._position.x += 2; };
enemy.advance = function () { this._position.y += 2; };

Try the same experiment as before and notice how we are, effectively, changing
the object's state.
enemy; // notice the position.
enemy.moveLeft();
enemy; // notice the position again.

The value of this
The value of this is one of JavaScript's most debated aspects.
In other languages, methods and functions are different things and a method
always has one – and only one – associated object, so this never changes.
But in JavaScript, this depends on how we call the function: whether we call
it as a function, or as a method.
Consider the following function:
function inspect() {
  // only inspects this
  console.log('Type:', typeof this);
  console.log('Value:', this);
}

And try the following:
// before trying each example, consider what might the value of this be.
var ship1 = { name: 'T-Fighter', method: inspect };
var ship2 = { name: 'X-Wing', method: inspect };
ship1.method();
ship2.method();
inspect();

In the latter case, the value of this is undefined because the function is not being used as a method, so there is no target.
In JavaScript, we can make a function take any object as its this. To do this, we shall use apply on a function.
var onlyNameShip = { name: 'Death Star' };
inspect.apply(onlyNameShip); // makes the value of this be onlyNameShip for inspect.

This is also known as the context object, and we shall use this term occasionally throughout these materials.
Additional considerations
Names and values
A variable is a name. Names are meaningless to the program, save for some exceptions.
A value is not a name. In fact, only functions can be named so that we can implement recursivity, as well as a couple extra things.
Therefore, the name one and the value 1 are not the same thing; and of course, there is no obligatory coherent relationship between name and value.
var uno = 2; // makes sense to the program, maybe not so much to the programmer.

Generally speaking, when dealing with booleans, strings and numbers, we say that names store values; while when speaking about objects and functions we say that names point to objects or functions, or that they reference objects or functions.
Functions, references to functions and calls to functions
There are two ways of defining a function. One is to use the function declaration, function:
// introduces a factorial variable which points to the factorial function.
function factorial(number) {
  if (number === 0) {
    return 1;
  }
  return number * factorial(number - 1);
} // no semicolon ';' needed in this case.

In this case, the name of the function (before the parentheses) is mandatory. Giving a name to a function has two implications:

It allows the implementation of recursive calls, like the one in the example.

It creates a name, factorial, to refer to that function by.


The other way is to use a function expression. This is more similar to the way we would create other values, such as numbers or strings:
// Introduces a recursiveFunction variable that points to ANOTHER factorial function.
var recursiveFunction = function factorial(number) {
  if (number === 0) {
    return 1;
  }
  return number * factorial(number - 1);
}; // now we do need a semicolon, just as in any other assignment.

In this last case, there are two names. One is the name of the function factorial, which exists so that we can refer to it within the function's body. The other is the recursiveFunction variable, which references the function.
The same function can be referenced by multiple variables or, put another way, have many names:
var a = recursiveFunction;
var b = recursiveFunction;
a === b; // true, they refer to the same function.
a.name; // the function name has nothing to do with that of the variable.
b.name; // same.
recursiveFunction !== factorial;

Neither should we confuse the reference to the function factorial and the call to the same function, for example, factorial(10).
The first expression refers to the object that encapsulates the code to be run. It requires no parameters because what we want is not to run the code, but to refer to the function.
With the second expression, we are asking the function to be executed and, therefore, all necessary parameters have to be provided.
Everything is an object in JavaScript
If, according to an alternate definition, we consider an object to be anything that may respond to a message, then it results that everything is an object in JavaScript.
Notice the following examples:
true.toString();
3.1415.toFixed(2);
'I want to be a pirate!'.split(' ');
({}).hasOwnProperty('x');
(function (parameter) { return parameter; }).length;

Types and object constructors
As we said before, JavaScript does not allow for the modeling of new types, which necessitates a "workaround". This is one of its key differences with other object-oriented languages.
What we do is to sidestep the notion of type altogether, so as to directly introduce the concept of constructor.

We are going to create two constructor functions: one for points, another for shots.
function newPoint(x, y) {
    var obj = {};
    obj.x = x;
    obj.y = y;

    return obj;
}

function newShot(position, velocity) {
    var obj = {};
    obj._position = position;
    obj._velocity = velocity;
    obj.advance = function () {
        this._position.y += this._velocity;
    };

    return obj;
}

Constructor functions are very similar in form: they create a void object, set the object's properties and return the new object.
Now we would be able to create shots with something like this:
// Positive velocity for downward movement.
var enemyShot = newShot(newPoint(15, 15), 2);

// Negative velocity for upwards movement.
var allyShot = newShot(newPoint(15, 585), -2);

enemyShot !== allyShot;

Reusing functionality
The problem with this approach is that we are creating different functions for identical behaviors: one function per object.
var s1 = newShot(newPoint(15, 15), 2);
var s2 = newShot(newPoint(15, 15), 2);
var s3 = newShot(newPoint(15, 15), 2);
s1.advance !== s2.advance;
s2.advance !== s3.advance;
s3.advance !== s1.advance;

This is highly inefficient, since every function takes up its own space in memory.
There is no need for so many functions, but rather only one, affecting several objects.
Therefore, it is best to create an object that contains only the API:
var shotAPI = {
    advance: function () {
        this._position.y += this._velocity;
    }
};

And use it in the object's creation so that it borrows the API's methods:
function newShot(position, velocity) {
    var obj = {};
    obj._position = position;
    obj._velocity = velocity;
    obj.advance = shotAPI.advance;
    return obj;
}

Now all instances share the same function, but every function affects the corresponding object, thanks to the value of this:
var s1 = newShot(newPoint(15, 15), 2);
var s2 = newShot(newPoint(15, 15), 2);
var s3 = newShot(newPoint(15, 15), 2);
s1.advance === s2.advance; // now they ARE the same.
s2.advance === s3.advance;
s3.advance === s1.advance;

In order to further strengthen the association between constructor and API, we shall perform a minor modification: creating the object with the API as a property of the constructor function, thereby grouping everything in the same place (the newShot function).
function newShot(position, velocity) {
    var obj = {};
    obj._position = position;
    obj._velocity = velocity;
    obj.advance = newShot.api.advance;
    return obj;
}

// A function is an object, so we can add a property to it.
newShot.api = {
    advance: function () {
        this._position.y += this._velocity;
    }
};

The prototype chain
JavaScript has a signature feature, unique to the language: the prototype chain.
You can experiment with it in Object Playground, an excellent tool that will help you visualize it.
The idea is not too complicated: the prototype chain is a property search list. Every item in the chain is the prototype of the prior item.
When you access a property of an object, this property is looked up in the object and if it is not found, it is looked up in the object's prototype, and so on until either the property or the chain's end are reached.
For instance:
obj1                    obj2               obj3
{ a: 1, b: 2, c: 3} --> { d: 4, e: 5 } --> { f: 6 }
obj1.c -------↑           ↑                  ↑
obj1.d -------------------|                  |
obj1.f --------------------------------------|
obj1.z ------------------------------------------------X
Creating this hierarchy in JavaScript requires the use of Object.create():
// The chain is assembled from rear to front.
var obj3 = { f: 6 };
// Chaining obj2 to obj3
var obj2 = Object.create(obj3);
obj2.d = 4;
obj2.e = 5;
// Chaining obj1 to obj2
var obj1 = Object.create(obj2);
obj1.a = 1;
obj1.b = 2;
obj1.c = 3;

obj1.c;
obj1.d;
obj1.f;
obj1.z; // undefined

The method Object.create() creates a new void object (like {}) whose prototype is the object we passed as a parameter.
The method hasOwnProperty can be used to determine whether a property belongs to an object without having to go through the prototype chain:
obj1.hasOwnProperty('c'); // true
obj1.hasOwnProperty('d'); // false
obj1.hasOwnProperty('f'); // false
obj1.hasOwnProperty('z'); // false

obj2.hasOwnProperty('c'); // false
obj2.hasOwnProperty('d'); // true
obj2.hasOwnProperty('f'); // false
obj2.hasOwnProperty('z'); // false

obj3.hasOwnProperty('c'); // false
obj3.hasOwnProperty('d'); // false
obj3.hasOwnProperty('f'); // true
obj3.hasOwnProperty('z'); // false

The method Object.getPrototypeOf() can be used to obtain an object's prototype:
Object.getPrototypeOf(obj1) === obj2;
Object.getPrototypeOf(obj2) === obj3;
Object.getPrototypeOf(obj3) === Object.prototype;
Object.getPrototypeOf(Object.prototype) === null;

Constructors and prototype chains
Prototypes are uniquely suited to contain the API, which is the common behavior to all objects of a given type.
var obj = newShot()                               newShot.api
{ _position: { x: 10, y: 10 }, _velocity: 2 } --> { advance: function ... };
obj._position.y ------↑                             ↑
obj.advance ----------------------------------------|
obj.goBack ------------------------------------------------------------------X
In order to establish this link, we shall modify our constructor as follows:
function newShot(position, velocity) {
    // With this, the API is the object's prototype.
    var obj = Object.create(newShot.api);
    obj._position = position;
    obj._velocity = velocity;

    return obj;
}

newShot.api = {
    advance: function () {
        this._position.y += this._velocity;
    }
};

Now try creating a new shot:
var shot = newShot({x: 0, y: 0}, 2);
shot; // on inspecting shot, only the object's properties are shown.
shot.advance; // but advance exists in its prototype.
shot.hasOwnProperty('advance'); // false
Object.getPrototypeOf(shot).hasOwnProperty('advance'); // true

If we do this for all constructors, we shall soon come across a pattern:

Create an object to contain the API.

Implement the API as properties of this object.

Within the constructor, make this object be the prototype to a new object.

Establish the properties of the new object with the state.

Return the new object.


Only steps 2 and 4 involve differences between this constructor and any others, the rest is exactly the same. So much so that JavaScript takes note of it, and comes with built-in mechanisms to automatize steps 1, 3 and 5.
First of all, JavaScript allows for any function to be used as a constructor. Because of this, everytime we type a function, JavaScript creates a property of the function called "prototype", which is an object with a single property, constructor, that points to the function.
function anyFunction() {}
anyFunction.prototype;
anyFunction.prototype.constructor === anyFunction;

This automatizes step 1: no longer do we need the api object that we would manually set. The prototype property is equivalent to the api property.
Now, upon calling the function with the operator new first, a new object whose prototype is precisely the function's "prototype" property is created:
var obj = new anyFunction();
var anotherObj = new anyFunction();

// The objects are different.
obj !== anotherObj;

// But their prototypes are the same.
Object.getPrototypeOf(obj) === Object.getPrototypeOf(anotherObj);

// Furthermore, they are the function's "prototype" property.
Object.getPrototypeOf(obj) === anyFunction.prototype;

With this, step 3 is automatized: it is no longer necessary to call Object.create() in order to establish the prototype chain between object and API (we get this automatically by using the new operator).
Finally, by calling it with new, the function receives as its context object (this) the element that is being created, which allows us to set its attributes.
function Hero(name) {
    this.name = name;
    this.sword = null;
    this.shield = null;
}

var hero = new Hero('Link');
hero;

If the function returns nothing, the result of the operator new will be the new object. This automatizes step 5: returning the new object is no longer necessary, as this return is implicit to using new.
Notice what the constructor for a point object would look like:
function Point(x, y) {
    this.x = x;
    this.y = y;
}

As for the shot:
function Shot(position, velocity) {
    this._position = position;
    this._velocity = velocity;
}

// The prototype does already exist, but we are adding the method advance() to it
Shot.prototype.advance = function () {
    this._position.y += this._velocity;
};

Now, creating the objects is a matter of using new. We will also use our new type, Point, to pass the position to the shot:
var enemyShot = new Shot(new Point(15, 15), 2);
var allyShot = new Shot(new Point(15, 585), -2);
enemyShot !== allyShot;

Inheritance
We have seen how objects with attributes are created; also how to do it efficiently, by using constructors and the prototype chain.
Now we shall see how an inheritance relationship is created. Remember the example for enemies and the player ship in the prior lesson:

We will need our points and shots:
function Point(x, y) {
    this.x = x;
    this.y = y;
}

function Shot(position, velocity) {
    this._position = position;
    this._velocity = velocity;
}

Shot.prototype.advance = function () {
    this._position.y += this._velocity;
};

The constructor and the methods for the enemies could be:
function Enemy(graphic, position, score) {
    this._graphic = graphic;
    this._currentDirection = 'right';
    this._position = position;
    this._score = score;
}

Enemy.prototype.moveLeft = function () { this._position.x -= 2; };
Enemy.prototype.moveRight = function () { this._position.x += 2; };
Enemy.prototype.advance = function () { this._position.y += 2; };

Enemy.prototype.shoot = function () {
    var firePosition = new Position(this._position.x, this._position.y + 10);
    var shot = new Shot(firePosition, 2);
    return shot;
};

And here, the implementation for the allied ship:
function Ally(position) {
    this._graphic = 'ally.png';
    this._position = position;
}

Ally.prototype.moveLeft = function () { this._position.x -= 2; };
Ally.prototype.moveRight = function () { this._position.x += 2; };

Ally.prototype.shoot = function () {
    var firePosition = new Position(this._position.x, this._position.y - 10);
    var shot = new Shot(firePosition, -2);
    return shot;
};

Now we can generalize and think of a constructor that envelopes the properties that are common to both types:
function Ship(graphic, position) {
    this._graphic = graphic;
    this._position = position;
}

Ship.prototype.moveLeft = function () { this._position.x -= 2; };
Ship.prototype.moveRight = function () { this._position.x += 2; };

In this case, it is probably best not to include the shoot method, since some ships shoot upwards and others downwards. We will not include advance either, as it is exclusive to enemies.

Keep in mind that, from now on, the constructors for both the allied ship and the enemies will first ask the ship constructor to create a ship, and then customize it.
function Enemy(graphic, position, score) {
    Ship.apply(this, [graphic, position]);
    this._currentDirection = 'right';
    this._score = score;
}

function Ally(position) {
    Ship.apply(this, ['ally.png', position]);
}

With apply we can execute a function specifying its context object, as well as its parameters.
With the previous configuration, all new instances of enemies and allies will first go through the Ship constructor, which will set the common attributes; these instances will then be modified individually by the relevant constructor, in order for them to become enemies or allies.
As for the API, it would be ideal to have a prototype chain after the following fashion:

Enemy (or ally) attributes are included in the instance itself.

The specific API for the Enemy or Ally types is in the prototype property of that type's constructor.

The API common to the Enemy and Ally types is in the prototype property of the Ship constructor.


var enemy = new Enemy()             Enemy.prototype      Ship.prototype
{ _position: ..., _score: ... } --> { advance: ... } --> { moveLeft: ... }
enemy._score -----↑                   ↑                    ↑
enemy.advance ------------------------|                    |
enemy.moveLeft --------------------------------------------|
As was the case for the example in the previous section, it is necessary to create the chain from the rear to the front. The link between instances and constructors is provided by JavaScript upon using new, but the link between the prototype property from Enemy and from Ship has to be manually set.
Try the following:
// Inspects Enemy's prototype.
Enemy.prototype;

// Links both prototype properties.
Enemy.prototype = Object.create(Ship.prototype);

// Inspects the prototype property again and scans for differences.
Enemy.prototype;

// Corrects the constructor property.
Enemy.prototype.constructor = Enemy;

// Adds the method specific to the type Enemy.
Enemy.prototype.advance = function () {
    this._position.y += 2;
};

// Another specific method.
Enemy.prototype.shoot = function () {
    var firePosition = new Point(this._position.x, this._position.y + 10);
    var shot = new Shot(firePosition, 2);
    return shot;
};

And for the Ally type:
// The same for the ally.
Ally.prototype = Object.create(Ship.prototype);
Ally.prototype.constructor = Ally;

Ally.prototype.shoot = function () {
    var firePosition = new Point(this._position.x, this._position.y - 10);
    var shot = new Shot(firePosition, -2);
    return shot;
};

Now we can finally create an enemy and an ally by using their constructors:
var enemy = new Enemy('enemy1.png', new Point(10, 10), 40);
var ally = new Ally(new Point(10, 590));

Object.getPrototypeOf(ally) === Ally.prototype;
Object.getPrototypeOf(enemy) === Enemy.prototype;
Ally.prototype !== Enemy.prototype;
Object.getPrototypeOf(Ally.prototype) === Object.getPrototypeOf(Enemy.prototype);
Object.getPrototypeOf(Ally.prototype) === Ship.prototype;

We can also check where every property is:
enemy.hasOwnProperty('_score');
enemy.hasOwnProperty('advance');
enemy.hasOwnProperty('moveLeft');

Enemy.prototype.hasOwnProperty('_score');
Enemy.prototype.hasOwnProperty('advance');
Enemy.prototype.hasOwnProperty('moveLeft');

Ship.prototype.hasOwnProperty('_score');
Ship.prototype.hasOwnProperty('advance');
Ship.prototype.hasOwnProperty('moveLeft');

Polymorphism
The inheritance relationships we have just established allow us to say that an enemy is an instance of the Enemy type, but also of the Ship type. A given instance can have multiple shapes, thanks to inheritance. In object-oriented programming this is called polymorphism.
Alternately, we can say an enemy is an instance of Enemy because it has the Enemy API, or that it is an instance of Ship because it has the Ship API. This is equivalent to saying that the prototype properties of Enemy and Ship are in the object's prototype chain.
The instanceof operator returns true if the prototype property of the function to the operator's right is in the prototype chain of the object to the left of the operator.
enemy instanceof Enemy;  // Enemy.prototype is the first link.
enemy instanceof Ship;   // Ship.prototype is the second.
enemy instanceof Object; // Object.prototype, the third.

enemy instanceof Ally;   // Ally.prototype is not in the chain.

Regarding the state, it is convenient to know which constructor has built the object, so that we can know at a glance which attributes it will contain. This is equivalent to determining which is the function whose prototype property is the first link in the prototype chain.
Given that the prototype objects come with a built in constructor property, which by default points to the function which owns the prototype object, all we need is to access the constructor property through the instance.
enemy.constructor;
enemy.constructor === Enemy; // it was built by Enemy, not by Ship.
enemy.constructor !== Ship; // it is true that Ship was used, but nothing else.

Duck typing

In other words, don't check whether it IS-a duck: check whether it
QUACKS-like-a duck, WALKS-like-a duck, etc, etc, depending on exactly what
subset of duck-like behaviour you need to play your language-games with.

Alex Martelli on polymorphism
The quote refers to how it is not so much a matter of checking whether something is an instance of a type, as rather checking whether it has the necessary functionality.
JavaScript is so dynamic that the instanceof operator and the constructor property only make sense if the conventions we have just covered are followed.
Nothing prevents us from deleting the constructor property from a prototype or overwriting it in a specific object. As a matter of fact, in the newer versions of JavaScript, an object's prototype can change after the object's construction.

02-javascript/0203-modelo-de-ejecucion/.body:
The JavaScript execution model
One of JavaScript's signature features is its asynchronous execution model, where results are not immediately available, but will be in the future.
Scope and hoisting
As in so many other languages, the names of variables can be reutilized to store different values, as long as they are located in different scopes.
A variable's scope is the segment of code where it can be used. Variables with the same name in different scopes are different variables.
In JavaScript, scope is the function's body, demarcated by the pair of braces { and } which follow the function's parameter list.
function introduction() {
    // This is a variable called text.
    var text = 'I\'m Ziltoid, the Omniscient.';
    greetings();
    console.log(text);
}

function greetings(list) {
    // And this is a DIFFERENT variable, also called text.
    var text = 'Greetings humans!';
    console.log(text);
}

introduction();

In JavaScript, functions can be defined within other functions, thereby enabling nested scopes.
Function nesting is useful when we want to use auxiliar functions, which are normally short.
function getEven(list) {
    function isEven(n) {
        return n % 2 === 0;
    }
    return list.filter(isEven);
}

getEven([1, 2, 3, 4, 5, 6]);

Since the scope is that of the function itself, the same name in a nested function can refer to two things:
1) If it is used with var, we are introducing another, different variable:
function introduction() {
    // This is a variable called text.
    var text = 'I\'m Ziltoid, the Omniscient.';

    function greetings(list) {
        // And this is ANOTHER different variable called text.
        var text = 'Greetings humans!';
        console.log(text);
    }

    greetings();
    console.log(text);
}

introduction();

In the above case, we say that the variable text from the nested function greetings hides the variable text from the function introduction.
Remember that, in order to introduce a new variable, we have to declare it with var before using it (or at the same time we are assigning it).
2) If we skip the word var, no new variable is created, but it is the existing one that is reused.
function introduction() {
  // This is a variable called text.
  var text = 'I\'m Ziltoid, the Omniscient.';

  function greetings(list) {
    // This is THE SAME variable called text as the one above.
    text = 'Greetings humans!';
    console.log(text);
  }

  greetings();
  console.log(text);
}

introduction();

Hoisting
Hoisting, in the context of programming, refers to a mechanism some languages employ in regards to name declaration.
In JavaScript, it makes no difference at which point through a function we declare a variable. JavaScript parses any declaration as occurring at the beginning of the function.
I.e., this:
function f() {
    for (var i = 0; i 
Is equivalent to this:
function f() {
    var i;
    var j;
    for (i = 0; i 
Do notice that JavaScript hoists the declaration of the variable (it takes it to the beginning), not its initialization. That is the reason the following piece of code does not fail, but prints out undefined:
function f() {
    console.log(i);
    var i = 5;
}
f();

In strict mode, using a variable that has not been declared will cause an error.
function f() {
    console.log(i);
    i = 5;
}
f();

This is not an issue with function declarations: when a function declaration is hoisted, it is hoisted as a whole, definition included.
function getEven(list) {
    return list.filter(isEven);

    function isEven(n) {
        return n % 2 === 0;
    }
}

getEven([1, 2, 3, 4, 5, 6]);

This allows a way of arranging code that might be clearer, placing auxiliar functions right after the functions that use them.
This way, just from a look at the first line of the function, we can know what it does.
    return list.filter(isEven);

And, should we still be in doubt, we can continue to read and look into what the auxiliar function does.
    function isEven(n) {
        return n % 2 === 0;
    }

Do notice that for this way of writing code to be clear, the names we use for auxiliar functions must be suitable, descriptive, and hint at the value they return.
Closures
Functions are data and are created every time a function instruction is found. This way, we can create functions that return functions.
function buildFunction() {
    return function () { return 42; };
}

var f = buildFunction();
var g = buildFunction();

typeof f === 'function';
typeof g === 'function';

f();
g(); // Both functions do the same thing...

f !== g; // ...but are NOT the same function

On its own, this is not a very powerful mechanism; however, now that we know nested functions can access variables from higher scopes, we can do something like this:
function newDie(sides) {
  return function () {
    return Math.floor(Math.random() * sides) + 1;
  };
}
var d100 = newDie(100);
var d20 = newDie(20);

d100 !== d20; // different, created in two different newDie calls.

d100();
d20();

In JavaScript, functions retain access to variables from higher scopes. A function referring to any variable from a higher scope is called a closure.
This does not affect the value of this, which will continue to be the message's target.
Methods, closures and this
Consider the following example:
var diceUtils = {
    history: [], // keeps a history of die rolls.

    newDie: function (sides) {
        return function die() {
            var result = Math.floor(Math.random() * sides) + 1;
            this.history.push([new Date(), sides, result]);
            return result;
        }
    }
}

Our intent is to be able to create dice and keep a record of all the rolls we make with these dice.
However, this does not work:
var d10 = diceUtils.newDie(10);
d10(); // error!

This is so because this is always the message's target and d10 is being called as if it were a function rather than a method.
Remember that we can make any function take a fixed value as this with .apply(); so this does work, although it is not very convenient:
d10.apply(diceUtils);
d10.apply(diceUtils);
diceUtils.history;

What we need to do is to make it so that the function die within newDie will refer to the this from the higher scope, not its own.
We can achieve this in two different ways. The first is a mere play on variables, storing thisto an auxiliar variable (in this case, self):
var diceUtils = {
    history: [], // keeps a history of die rolls.

    newDie: function (sides) {
        var self = this; // self is now the target of newDie.

        return function die() {
            var result = Math.floor(Math.random() * sides) + 1;
            // by using self, we refer to newDie's target.
            self.history.push([new Date(), sides, result]);
            return result;
        }
    }
}

This does work, and is far more convenient:
var d10 = diceUtils.newDie(10);
var d6 = diceUtils.newDie(6);
d10();
d6();
d10();
diceUtils.history;

The second way is to use the functions' bind method.
A function's bind method returns another function whose this will be the first parameter of bind. Thus:
var diceUtils = {
    history: [], // keeps a history of die rolls.

    newDie: function (sides) {
        return die.bind(this); // a new function that calls die with its target set on the first parameter.

        function die() {
            var result = Math.floor(Math.random() * sides) + 1;
            this.history.push([new Date(), sides, result]);
            return result;
        }
    }
}

Both forms are widely used, but the second is often seen written this way:
var diceUtils = {
    history: [], // keeps a history of die rolls.

    newDie: function (sides) {
        return function die() {
            var result = Math.floor(Math.random() * sides) + 1;
            this.history.push([new Date(), sides, result]);
            return result;
        }.bind(this); // bind follows the function expression.
    }
}

Modules
This section introduces the modules feature, which is specific to Node.
One of the main disadvantages to JavaScript (until next version) is that there is no way of arranging code in modules.
Modules are useful for isolating related functionality: types, functions, constants, configuration…
Node does have modules and, luckily, there are tools that simulate modules like Node's on the browser.
In Node, JavaScript files ending by .jsare modules. Node allows us to expose or export functionality from a module, placing it within the object module.exports:
// In diceUtils.js
"use strict"; // sets the module to strict mode.

var history = [];

function newDie(sides) {
    return function die() {
        var result = Math.floor(Math.random() * sides) + 1;
        history.push([new Date(), sides, result]);
        return result;
    };
}

// What is exported is actually the object module.exports!
module.exports.newDie = newDie;
module.exports.history = history;

What is actually exported is always module.exports, which starts out as an empty object:
typeof module.exports;
module.exports;

Now we can import that module within another:
// In cthulhuRpg.js
"use strict";

var diceUtils = require('./diceUtils');
var d100 = diceUtils.newDie(100);

var howard = {
    sanity: 45,
    sanityCheck: function () {
        if (d100() 
In order to import one module from another we need to pass to require the relative route to the module file we want to import.
If we pass a name instead of a route, we will access the default funcionality that comes with Node (modules that are part of the standard library, such as path or fs) or the one we install from third parties (for instance, modules installed with the npm package manager). We shall use this form in a couple of occasions later on.
Differences in scope between Node and the browser
It has been said that scope in JavaScript is equivalent to the function, but we also know that we can open a console or a file and start declaring variables without need of writing functions.
This happens because we are using the global scope. The global scope is available both to the browser and Node.
// This is a variable called text within the GLOBAL scope.
var text = 'I\'m Ziltoid, the Omniscient.';

// This is a function within the GLOBAL scope.
function greetings(list) {
    // This is ANOTHER variable called text, within the function's scope.
    var text = 'Greetings humans!';
    console.log(text);
}

greetings();
console.log(text);

However, there is a peculiarity to Node. The global scope is actually local in regards to the file. This means that:
// In a.js, text is only visible from within the FILE.
"use strict";
var text = 'I\'m Ziltoid, the Omniscient.';

// In b.js, text is only visible from within the FILE.
"use strict";
var text = 'Greetings humans!';

// In a console run from the same directory as a & b
require('./a');
require('./b');
text;

Events and asynchronous programming
Try the following example (copy, paste and wait for 5 seconds):
var fiveSeconds = 5 * 1000; // in milliseconds.

// This happens now.
console.log('T: ', new Date());

setTimeout(function () {
    // This happens after 5 seconds.
    console.log('T + 5 seconds: ', new Date());
}, fiveSeconds);

// This happens immediately thereafter
console.log('T + delta: ', new Date());

As may have realized, the message is completed after 5 seconds because what setTimeout does is to call the function as soon as the stated amount of milliseconds has elapsed.
We say a function is a callback if it is called at some point in the future –that is to say, asynchronously– in order to report on some result.
In the setTimeout example, the result is that the specified amount of time has passed.
Events
In this section we will look at the readline module, which is specific to Node.
Asynchronous programming is used in JavaScript and other languages to model events, mainly input/output waits. In other words: milestones that happen without us knowing when.
Input/output –from now on, I/O– does not just consist of reading from files or network requests, but also waiting for an action on the user's part.
As an example, we shall implement a line-by-line dialog console. We will use the readline module, which is a part of the standard library that comes built in with node:
// In conversational.js
"use strict";

var readline = require('readline');

var cmd = readline.createInterface({
    input: process.stdin,  // this way, we reference the console as input.
    output: process.stdout, // and this way, as output.
    prompt: '(╯°□°）╯ ' // what shows up in order to wait for user input.
});

Launch that program with Node and you will see it does nothing, yet neither does it end. This is typical of asynchronous programs: the program remains in wait for something to happen. Press ctrl+c to terminate the program.
Now try this:
// Add at the end of conversational.js
console.log('Write something and press enter');
cmd.prompt(); // asks the user to write something.

cmd.on('line', function (input) {
    console.log('You have said "' + input  + '"');
    cmd.prompt(); // asks the user to write something.
});

What you have achieved here is to listen for the line event that happens every time a new line character is input.
Speaking of events, the function that is asynchronously executed is called listener, but it is not uncommon for it to be called callback.
Expressions like "registering a listener for an event", "subscribing to an event" or "listening for an event" mean utilizing the mechanism that allows the association of a function's execution to said event.
All of this said, we cannot exit the prior program yet. We need to make some further changes:
// Add to conversational.js
cmd.on('line', function (input) {
    if (input === 'exit') {
        cmd.close();
    }
});

cmd.on('close', function () {
    console.log('See you!');
    process.exit(0); // exits Node.
});

We have added a second listener to the line event and both will be run. The first manages the default behavior (which is to repeat what the user has typed in), and the second deals specifically with the exit command.
If the line is exactly exit, we will close the command line interface. This causes a close event and, when we receive it, we will use that event's listener in order to terminate the program.
The on method is an alias for addListener.
We can remove a listener the same way we add it by using removeListener,
or remove all of them with removeAllListeners.
We can listen for an event just once with once.
Event emitters
Now we shall cover the EventEmitter class, which is also specific to Node.
Events are not a standard mechanism to JavaScript. They are a convenient way of modeling certain types of problems; but a JavaScript object, on its own, has no event-emitting API.
In Node, we can rely on several alternatives in order to have objects emit events:

Implementing our own event API.

Having our objects use an instance of EventEmitter.

Having our objects be instances of EventEmitter.


The first option would imply the creation of our own on method, as well as the mechanisms for event emission. The second and third both use the EventEmitter class, which already implements this API.
This is an example of option 3, which we will take as an opportunity to review the notion of inheritance:
var events = require('events');
var EventEmitter = events.EventEmitter;

function Ship() {
    EventEmitter.apply(this);
    this._ammunition = 'laser charges';
}

Ship.prototype = Object.create(EventEmitter.prototype);
Ship.prototype.constructor = Ship;

var ship = new Ship();
ship.on; // it exists!

Now that the ship can emit events, we shall make it emit an event by shooting.
Ship.prototype.shoot = function () {
    console.log('VOIP!');
    this.emit('shoot', this._ammunition); // part of the EventEmitter API.
};

ship.on('shoot', function (ammunition) {
    console.log('THIS IS COMMAND. The ship has fired:', ammunition);
});

ship.shoot();

Emitting an event consists of calling the emit method, which will trigger the execution of the listeners that listen for this event.
Events are incredibly useful in the generic modeling of user interfaces.
To this end, models must publish what is happening to them: how they change, what they do… all of it through events. User interfaces will subscribe to these events and will provide the necessary visual information.
This model also allows for several user interfaces to work simultaneously, all of them listening for the same events. However, it also allows us to divide an interface into other, more specialized ones, all of them listening for specific sets of events.

02-javascript/02-ejercicios/.body:
Guided exercises
Test these examples and try to answer the questions. If you get stuck guessing what a function does, search the Internet for the function, followed by "mdn".
1. Booleans in JavaScript.
In JavaScript, any value can be considered true or false depending on context. For instance, 0 is considered false, and any number different than 0 is true:
var v = 0; // after this test, change the value of v for another number.
!!v; // a double negation at the beginning turns it into a boolean.

Find out which values are true and which are false for all types: numbers, strings, objects, functions, and undefined.
2. Boolean expressions in JavaScript.
In JavaScript, boolean expressions are vague; this means we stop evaluating as soon as the JavaScript interpreter knows what the expression is going to equal. For instance, what do you think will happen to the following expression?
var hero = { name: 'Link', weapon: null };
console.log('Hero weapon power is:', hero.weapon.power);

Then again, what now?
var hero = { name: 'Link', weapon: null };
if (hero.weapon && hero.weapon.power) {
  console.log('Hero weapon power is:', hero.weapon.power);
} else {
  console.log('The hero has no weapon.');
}

In the case of && (and) expressions, evaluation ends as soon as we find a false term.
In the case of || (or) expressions, evaluation ends as soon as we find a true term.
3. The result of a boolean expression.
Counter to common sense, the result of a boolean expression is not a boolean, but the last evaluated term. Remember, evaluation is vague and JavaScript stops evaluating as soon as it can determine the expression's result. Keeping this in mind, try to predict the result of the following expressions:
var v;
function noop() { return; };

1 && true && { name: 'Link' };
[] && null && "Spam!";
null || v || noop || true;
null || v || void "Eggs!" || 0;

4. Default parameters.
You can see a real application of the above in this number-filling function. There are no default parameters in JavaScript, but skipped parameters have the special value undefined, which is false.
function pad(target, targetLength, fill) {
  var result = target.toString();
  var targetLength = targetLength || result.length + 1;
  var fill = fill || '0';
  while (result.length 
5. Best practices in API design.
It is often said that the state should not be made explicit, but this modeling for points always ends up as an example:
var p = { x: 5, y: 5 };

function scale(point, factor) {
  point.x = point.x * factor;
  point.y = point.y * factor;
  return p;
}

scale(p, 10);

The correct implementation would be:
var p = {
  _x: 5,
  _y: 5,
  getX: function () {
    return this._x;
  },
  getY: function () {
    return this._y;
  },
  setX: function (v) {
    this._x = v;
  },
  setY: function (v) {
    this._y = v;
  }
};

function scale(point, factor) {
  point.setX(point.getX() * factor);
  point.setY(point.getY() * factor);
  return p;
}

scale(p, 10);

Though we have to admit, writing so much is a royal pain.
7. Computed properties to the rescue.
JavaScript allows the definition of a special type of properties, usually called computed properties, in this fashion:
var p = {
  _x: 5,
  _y: 5,
  get x() {
    return this._x;
  },
  get y() {
    return this._y;
  },
  set x(v) {
    this._x = v;
  },
  set y(v) {
    this._y = v;
  }
};

function scale(point, factor) {
  point.x = point.x * factor;
  point.y = point.y * factor;
  return p;
}

scale(p, 10);

Writing that is still a chore (good thing you have studied how to create object factories!), but using it is much clearer. This way, should you decide now that it would be better to show the names of the X/Y axes in caps, you can do this:
var p = {
  _x: 5,
  _y: 5,
  get X() {
    return this._x;
  },
  get Y() {
    return this._y;
  },
  set X(v) {
    this._x = v;
  },
  set Y(v) {
    this._y = v;
  }
};

function scale(point, factor) {
  point.X = point.X * factor;
  point.Y = point.Y * factor;
  return p;
}

scale(p, 10);

Can you guess the way to make a property read-only? That is to say, for its value to be unchangeable (assuming the user will not access any properties beginning by _)?
If you wanted to add a property to an already existing object, you would have to use Object.defineProperty():
var point = {};
Object.defineProperty(point, '_x', { value: 5, writable: true });
Object.defineProperty(point, '_y', { value: 5, writable: true });
Object.defineProperty(point, 'x', {
  get: function () {
    return this._x;
  },
  set: function (v) {
    this._x = v;
  }
});
Object.defineProperty(point, 'y', {
  get: function () {
    return this._y;
  },
  set: function (v) {
    this._y = v;
  }
});
point; // no properties are appreciable...
point.x; // ...but here they are.
point.y;

Dare you explain why, when we inspect the object, its properties are not displayed? How would you fix it? What would you do so that only the properties which are a part of the API can be seen?
Do not just go and use Object.defineProperty() unless you have a very clear notion of what the terms configurable, enumerable and writable mean.
7. Using functions in lieu of methods.
We have seen how any function can be used as a method if it is referenced as an object's property and then called. But the fact of the matter is, you can also make any function (regardless of whether it is referenced from a property) work as an object's method if you explicitly designate the target object. This can be done with .apply() and .call().
var ship = { name: 'Death Star' };

function fire(shot) {
  console.log(this.name + ' is firing: ' + shot.toUpperCase() + '!!!');
}

ship.fire; // what do you think this is?
fire.apply(ship, ['voip']);
fire.call(ship, 'pew');

What is the difference between .apply() and .call()?
8. Dynamic properties.
The bracketed notation for accessing an object's properties is especially useful for accessing properties in a generic way. For instance, picture the following piece of code:
var hero = {
  name: 'Link',
  hp: 10,
  stamina: 10,
  weapon: { name: 'sword', effect: { hp: -2 } }
};
var enemy = {
  name: 'Ganondorf',
  hp: 20,
  stamina: 5,
  weapon: { name: 'wand', effect: { hp: -1, stamina: -5 } }
};

function attack(character, target) {
  if (character.stamina > 0) {
    console.log(character.name + ' uses ' + character.weapon.name + '!');
    applyEffect(character.weapon.effect, target);
    character.stamina--;
  } else {
    console.log(character.name + ' is too tired to attack!');
  }
}

function applyEffect(effect, target) {
  // Obtains names of object properties. Look it up on the MDN.
  var propertyNames = Object.keys(effect);
  for (var i = 0; i 
Could you modify the hero's weapon effect so that it can incapacitate the enemy, but not kill him or damage him? Try to do it without rewriting the whole example, i.e., picking up from where the example ends.
9. Objects as something more than objects.
JavaScript objects do not only serve the purpose of modeling object-oriented programming objects, but also allow classifications by name. A histogram, i.e. a count of a set with repetitions, is a textbook example of the versatility of JavaScript objects:
function wordHistogram(text) {
  var wordList = text.split(' ');
  var histogram = {};
  for (var i = 0; i 
Try to use the function by yourself.
What JavaScript calls objects is known in other programming languages as maps or dictionaries, and property names are also known as keys.
Can you think of at least one more application?
10. Functions as parameters.
JavaScript lists have some methods which accept functions as parameters, for instance .forEach(). In fact, .forEach() is commonly found whenever there is the certainty that we are going to go over all of the elements in a list.
function wordHistogram(text) {
  var wordList = text.split(' ');
  var histogram = {};
  wordList.forEach(function (word) {
    if (!histogram.hasOwnProperty(word)) {
      histogram[word] = 0;
    }
    histogram[word]++;
  });
  return histogram;
}

var poem = 'All passes and all remains, ' +
           'but \'tis our lot to pass, ' +
           'pass by making pathways, ' +
           'pathways o\'er the sea';

wordHistogram(poem);

The result is not correct, since by separating words by their spaces you are leaving out characters that are not part of the words themselves. You can fix this if, rather than splitting the text by the spaces, you use a regular expression in order to split the text by the words' ends:
function wordHistogram(text) {
  var wordList = text.split(/\b/); // The thing between / / is a regular expression.
  var histogram = {};
  wordList.forEach(function (word) {
    if (!histogram.hasOwnProperty(word)) {
      histogram[word] = 0;
    }
    histogram[word]++;
  });
  return histogram;
}

var poem = 'All passes and all remains, ' +
           'but \'tis our lot to pass, ' +
           'pass by making pathways, ' +
           'pathways o\'er the sea';

wordHistogram(poem);

But now you will have things that are not words, such as spaces and commas. You can filter a list by using .filter():
function isEven(n) { return n % 2 === 0; }
[1, 2, 3, 4, 5, 6].filter(isEven);

And thus remove anything which is not a word:
function isWord(candidate) {
  return /\w+/.test(candidate);
}

function wordHistogram(text) {
  var wordList = text.split(/\b/);
  wordList = wordList.filter(isWord);
  var histogram = {};

  wordList.forEach(function (word) {
    if (!histogram.hasOwnProperty(word)) {
      histogram[word] = 0;
    }
    histogram[word]++;
  });
  return histogram;
}

var poem = 'All passes and all remains, ' +
           'but \'tis our lot to pass, ' +
           'pass by making pathways, ' +
           'pathways o\'er the sea';

wordHistogram(poem);

You should also normalize the words (making them all-lowercase, for instance) so as to avoid finding different histogram entries for the same word. In order to transform a list into another list with the same amount of items, we use .map().
function isWord(candidate) {
  return /\w+/.test(candidate);
}

function toLowerCase(word) {
  return word.toLowerCase();
}

function wordHistogram(text) {
  var wordList = text.split(/\b/);
  wordList = wordList.filter(isWord);
  wordList = wordList.map(toLowerCase);
  var histogram = {};

  wordList.forEach(function (word) {
    if (!histogram.hasOwnProperty(word)) {
      histogram[word] = 0;
    }
    histogram[word]++;
  });
  return histogram;
}

var poem = 'All passes and all remains, ' +
           'but \'tis our lot to pass, ' +
           'pass by making pathways, ' +
           'pathways o\'er the sea';

wordHistogram(poem);

One last function allows us to transform a list into a single value. This is precisely the histogram, a classification of all of the values in the list. This transformation is achieved by using .reduce():
function isWord(candidate) {
  return /\w+/.test(candidate);
}

function toLowerCase(word) {
  return word.toLowerCase();
}

function buildHistogram(inProgressHistogram, word) {
  if (!inProgressHistogram.hasOwnProperty(word)) {
    inProgressHistogram[word] = 0;
  }
  inProgressHistogram[word]++;
  return inProgressHistogram;
}

function wordHistogram(text) {
  var emptyHistogram = {};
  return text.split(/\b/)
             .filter(isWord)
             .map(toLowerCase)
             .reduce(buildHistogram, emptyHistogram);
}

var poem = 'All passes and all remains, ' +
           'but \'tis our lot to pass, ' +
           'pass by making pathways, ' +
           'pathways o\'er the sea';

wordHistogram(poem);

11. Variable parameter counts.
Check this out:
console.log('I\'m', 'Ziltoid');
console.log('I\'m', 'Ziltoid,', 'the', 'Omniscient');
Math.max(1);
Math.max(1, 2);
Math.max(1, 2, 3);

As you can see, the function accepts any amount of variables. We can do the same thanks to the implicit variable, arguments.
function f() {
  console.log('Amount of arguments passed:', arguments.length);
  console.log('Arguments:', arguments);
}
f();
f(1);
f('a', {});
f(function () {}, [], undefined);
Look up the info on arguments on the MDN. You will need it!
12. Decorators.
Aside from being returned as parameters, functions can be returned from other functions. Consider the following example:
function newLog(label) {
  return function(value) {
    console.log(label + ':', value);
  }
}

This function creates other functions that will call console.log(), but with a tag preceding it. We could create log methods on a class-by-class basis, each with a prefix, and thus be able to tell different logs from each other.
However, do notice the following behavior:
var log1 = newLog('Default');
var log2 = newLog('Ziltoid');

var p = { x: 1, y: 10 };
log1(p);
log2(p);
log1('Greetings', 'humans!');

What is the problem? Why is the last example not working?
To make it work, you would need to call console.log() with a number of parameters we do not know beforehand. You can use arguments, however:
function newLog(label) {
  return function() {
    // Why do we have to do this?
    var args = Array.prototype.slice.call(arguments);
    args.splice(0, 0, label + ':');
    console.log.apply(console, args);
  }
}

var log1 = newLog('Default');
var log2 = newLog('Ziltoid');

var p = { x: 1, y: 10 };
log1(p);
log2(p);
log1('Greetings', 'humans!');

Can you tell what each line in the newLog function does?
13. Asynchrony and closures.
Load up the following code:
function scheduleTasks(count) {
  for(var i = 1; i 
And try to predict what will happen when you run the following code:
scheduleTasks(5);

Did it do what you expected? If not, why? How would you fix it? Here goes a clue: you need the .bind() function.
14. Events and methods.
There will be occasions when you will need to call a method from an object when something happens. For instance, suppose that the 'advance' method of a given object has to be called within an interval. Shall we say, every second:
var obj = {
  x: 10,
  y: 2,
  advance: function () {
    this.y += 2;
    console.log('Now Y equals', this.y);
  }
};

var id = setInterval(obj.advance, 1 * 1000);

This example fails because in the last line we are not calling the function, but only passing it as a parameter. The setInterval function has no idea of the message's target, and therefore cannot call the function as if it were a method.
We can fix this with bind, but first you need to stop the interval with:
clearInterval(id);

You can solve the issue with:
var id = setInterval(obj.advance.bind(obj), 1 * 1000);

15. The bind() function.
At this stage, you should already know how bind works, or what it does. If you are not too clear on that, look it up on the MDN.
Your task is the following: create a bind function that simulates the behaviour of .bind() functions' method. Since what is requested is a function and not a method, the first parameter will be the function. Therefore, instead of using it this way:
function die(sides) {
  var result = Math.floor(Math.random() * sides) + 1;
  this.history.push(result);
  return result;
}
var obj = { history: [] };
var d20 = die.bind(obj, 20);
d20();

You will be using it this other way:
function die(sides) {
  var result = Math.floor(Math.random() * sides) + 1;
  this.history.push(result);
  return result;
}
var obj = { history: [] };
var d20 = bind(die, obj, 20); // notice that now die is the first parameter
d20();

02-javascript/02-practica/TDD.html.body:
TDD: Test-driven development
By practicing TDD, we will get to write code so that it passes tests. These tests are already there, but disabled. The practice guide recommends an optimal order we can enable the tests in, so as to gradually fulfill the practice.
Tests and suites
Throughout this practice, we shall use Jasmine as a test framework. We write suites and tests in Jasmine. Suites can be nested and they can also include initialization code. The Jasmine API is generally crystal clear, and does not need much more in the way of explanation. In any case, here goes an example:
describe('Suites in Jasmine', function () {

  describe('can be nested', function () {

    it('and enclose tests with expectations', function () {
      expect(2 + 2).toBe(4);
    });

  });

});

We call 'test' a code fragment that checks for a specific functionality. The test can pass or fail. In case of failure, the console will show the reason it did so by means of a trace:
15.2) Expected 'b' to be 'c'.
    Error: Expected 'b' to be 'c'.
        at stack (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1640:17)
        at buildExpectationResult (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1610:14)
        at Spec.expectationResultFactory (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:655:18)
        at Spec.addExpectationResult (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:342:34)
        at Expectation.addExpectationResult (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:599:21)
        at Expectation.toBe (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1564:12)
        at Object. (/Users/salva/workspace/pvli2017-rpg-battle/spec/TurnList.js:39:36)
        at attemptSync (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1950:24)
        at QueueRunner.run (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1938:9)
        at QueueRunner.execute (/Users/salva/workspace/pvli2017-rpg-battle/node_modules/jasmine-core/lib/jasmine-core/jasmine.js:1923:10)

The trace contains both the failure and where it happened in the set of calls, from the most recent to the earliest. Failures are sometimes a consequence of implementations not fulfilling expectations, some other times they will be due to runtime errors, and on yet other occasions they will be the product of syntax errors.
Get used to failing, as well as searching the trace for the exact point in the code that is up for you to fix. In order to do this, look for the spec and src folders in the trace. The first number after the path will be the line that contains the failure.
Enabling and disabling tests
Tests and suites can be disabled by adding the prefix, x. For instance:
describe('Suites in Jasmine', function () {

  describe('can be nested', function () {

    it('and enclose tests with expectations', function () {
      expect(2 + 2).toBe(4);
    });

    xit('this test is disabled', function () {

    });

  });

  xdescribe('the suite and all of its tests are disabled.', function () {

  });

});

Disabled tests will not check for expectations, but Jasmine will report that they are disabled.
The development cycle
Whenever you are developing, it is best for you to run the tests often for two reasons:

To check whether you are advancing.
To check whether you have broken anything.

To do this, you can run the command:
$ npm run-script watch
This task monitors changes in the files within the spec and src folders, and will launch all of the tests when it detects a change.
Sometimes, an error is catastrophic enough that it will break the monitoring. Should that happen, you will have to manually reenter the command.
Make a new commit anytime you make a modification and it passes the tests.
Debugging asynchronous tests
Some tests are asynchronous and can cause timeouts. Generally speaking, a timeout is not a desirable outcome. The problem with timeouts is that they can slow the whole suite down, so the recommended course of action in these cases is to tackle them one by one, by disabling the rest and enabling them gradually.
You will recognize asynchronous tests because they have a done parameter, as in the example:
var EventEmitter = require('events').EventEmitter;

describe('EventEmitter', function () {

  it('emits arbitrary events', function (done) {
    var ee = new EventEmitter();
    ee.on('turn', function(turn) {
      expect(turn.number).toBe(1);
      done();
    });
    ee.emit('turn', { number: 1 });
  });

});

General debugging strategy
It is very recommendable for you to keep a stable branch where all tests pass, and those which do not are disabled. Whenever you embark on the task of making a test pass, create a branch for that task, and merge it with the stable branch when it is done.
Whenever you find an error, try to follow these steps:

Disable the asynchronous tests that are taking too long. You need a fast development cycle.
Read the error!!
Search the trace for the place where the error is originated:
If it is a failed expectation, locate the entry point in your code.
Keep traces with console.log() inspecting your objects' state.


Save and reload the tests often.

03-javascript-en-el-navegador/0302-canva.body:
Canvas
The arrival of HTML5 brought us several HTML elements and JavaScript APIs that grant us the possibility of programming video games with Web standards and technologies; among them the  element and its JavaScript API, which allows us to draw graphics on the screen, both 2D and 3D.
The  element
This HTML tag creates a canvas of the specified width and height. On this canvas, we will be able to draw by using the Canvas API.


The dimensions of the canvas as specified in its HTML tag with width and height are not necessarily equivalent to on-screen size, but rather to a virtual size unit. By default, 1 of this unit equals 1 pixel; but CSS allows us to set the scale. For instance, the following code would scale our prior canvas to a 200% of its original size.
canvas {
    width: 640px;
    height: 480px;
}

We can take advantage of this and play around with the scale, or adapt our game to different screen sizes. For instance, this article explains how we can use scaling for retro video games with pixel art: Retro, crisp pixel art in HTML5 games.
The Canvas API
The Canvas API allows us to carry out 2D drawing operations on a  element. With it we can render images, manipulate pixels, draw graphical primitives, curves, etc.
Below are two important resources:

Documentation on the MDN.
Canvas Deep Dive: a concise yet comprehensive online book.

Contexts
In order to carry out any drawing operation, we need to obtain a 2D context from a . To this end, we shall use the getContext method and specify to it that we need a 2D context.
Example:
var ctx = document.querySelector('canvas').getContext('2d');
ctx.fillRect(10, 10, 100, 100);


See the online code snippet.
Colors, borders, etc.
The way the Canvas API does its work is similar to that of a drawing program. Within the context we set the styles (background color, border thickness, etc.) we want the "tools" (in this case, the drawing operations) to use.
Keep in mind this system has a "memory", and styles are kept from one operation to the next. That is to say, if we specify in the context that from now on we shall use the red color, all of the following drawing operations shall use this color, not only the next.
Example:
// red rectangles
ctx.fillStyle = '#FF004D';
ctx.fillRect(10, 10, 100, 100);
ctx.fillRect(190, 10, 100, 100);
// blue rect with white border
ctx.fillStyle = 'rgba(41, 173, 255, 0.8)';
ctx.fillRect(50, 50, 100, 100);
ctx.strokeStyle = '#fff';
ctx.lineWidth = 5;
ctx.strokeRect(50, 50, 100, 100);


See the online code snippet.
Images
We can render images on the canvas, but they need to be loaded first. The most trivial way of doing this is to use an image loaded with , but we can obtain images from other sources: the user's webcam, a , another  element, etc.
Example:



window.onload = function () {
    var img = document.getElementById('kitten');
    var ctx = document.querySelector('canvas')
        .getContext('2d');

    ctx.drawImage(img, 0, 0);
}

You can see the image created with , and the  element next to it, with the same image drawn:

The example works because the load event from window fires when all of the images included in the HTML document have loaded, so we know for sure that it is already available to be drawn on the canvas.
See the online code snippet.
Loading images on the fly
Having to create a  tag within our HTML for every image we want to load is bothersome. Most engines or game or graphics libraries dynamically create Image objects with JavaScript, which are not added to the DOM, and are therefore not visible.
The steps to loading an image this way would be:

We use the constructor Image.
We subscribe to the load event (in order to draw the image when it has loaded).
We set the src attribute of the image in order to start loading.

window.onload = function () {
    var img = new Image();
    img.addEventListener('load', function () {
        ctx.drawImage(img, 0, 0);
    });
    img.src = 'https://placekitten.com/g/300/300';
}


See the online snippet de código.
Further info on image loading
 elements which have the display:none style are invisible to the user, but they are still loaded all the same. This is commonly used in order to hide the images that are drawn on the canvas. As we have mentioned previously, the load event of window fires when –among other things– all of the images in the DOM have loaded, whether they are visible or not. Due to this, we can load images using only HTML and CSS, although it is something of a chore.
In order to load images from JavaScript, using new Image instances, we often use Promises, or a counter in order to check whether all of them are done loading.
Other Canvas API operations
The Canvas API is extensive and allows us to carry out many other operations, among them:

Drawing curves and complex paths
Gradient paintingPintar gradientes
Clipping
Transformations
Pixel manipulation
Etc.

WebGL
WebGL is an API that allows us to operate with 3D graphics in a  element. Its philosophy is completely different from the Canvas API; it is a far more complex API, but also a very powerful one.
WebGL is a JavaScript implementation of OpenGL ES 2.0, which is an industry standard for 3D graphics drawing.
In order to be able to use it, we need to obtain a 3D context from a  element. To this end, we must specify the webgl parameter –or experimental-webgl for some browsers– in the call for getContext.
There is documentation on this API available on the MDN.
2D Graphics on WebGL
In video game development, it is common to use a 3D graphics API for 2D video games. The reason is none other than performance: some operations executed on 3D graphics are more efficient, such as Z-ordering, rotation, transparency, etc.
There is the possibility of simulating a 2D world by using a 3D graphics API, such as WebGL. The "trick" is to use an orthographic projection, which does not warp objects due to perspective. 2D graphics are then polygons with a texture within this 2D space.
Many 2D game libraries and graphics engines in JavaScript –Pixi and Phaser among them– offer the possibility of using WebGL as their graphics API instead of Canvas's API.
Resources
For further learning on WebGL, we recommend the below resources:

WebGL on the MDN: documentation, guides, tutorials, etc.
Introduction to WebGL part 1 and part 2
WebGL fundamentals: step-by-step tutorials

Graphics libraries
There are two extremely popular graphical operation libraries for JavaScript. They are only graphics libraries, so they do not implement any other functionalities that are necessary for a video game. However, they make for a good starting point whether we are developing our own engine, or when we only need to draw graphics for a certain project.
Many engines use them as their graphics layer, so it is convenient to know them if we want to modify an engine or access features of these libraries that are not exposed by the engine.
2D Graphics: Pixi.js

www.pixijs.com
Works with WebGL by default, but it can fallback to Canvas 2D.
Phaser uses Pixi for graphics rendering.

3D Graphics: THREE.js

www.threejs.org
The reference library for graphics work on WebGL, which greatly simplifies the use of this API.
Makes it easier to render graphics for their use with WebVR (Web API for virtual reality).
There is an endless amount of tutorials, books and other documentation available.

Animations
So far we have only seen how to render static graphics on a canvas, but images on a video game are moving ones.
In video game development, we shall ideally aim to render images on the canvas 60 times per second (60 FPS, or frames per second). To this end, neither setTimeout or setInterval are reliable, since they are not accurate and there is nothing to guarantee that they will be executed (you can see the reasons for this in the documentation).
The proper way to render animations on a canvas is by using requestAnimationFrame.
requestAnimationFrame
This function takes a callback that will be automatically called the next time the browser can draw on the screen. Within this callback we shall include the drawing operations we want to carry out, as well as a new call to requestAnimationFrame, thus establishing a continuous loop.
Example:
function render() {
    ctx.clearRect(0, 0, canvas.width, canvas.height);
    ctx.fillRect(x, 25, 50, 50);
    x = (x + 1) % canvas.width;

    requestAnimationFrame(render);
}

requestAnimationFrame(render);

You can see a comparison of the same rendering code running with requestAnimationFrame and with setInterval. You can see how the animation with requestAnimationFrame is more fluid, especially if you change tabs in the browser, switch it to the background, etc.

Code snippet using requestAnimationFrame.
Code snippet using setInterval.

Delta Time
Delta Time is the name given in video game development to the time elapsed between the current frame and the next. It is necessary for this time to be accurate, as much of the game logic relies on it: animation, physics, etc.
Although Date is usually employed in Web programming for date management, not only is it inefficient to create repeated instances of Date, but these objects do not have the necessary resolution for a video game, which usually demands miliseconds in the decimal range.
There is an alternative, which is to use timestamp objects, DOMHighResTimeStamp, such as those returned by using the Performance interface. These timestamps have a margin of error of only 5 microseconds. In addition, and much to our convenience, requestAnimationFrame calls our callback with a timestamp.
In practice, this parameter allows us to accurately calculate the delta time. The timestamp we obtain contains the amount of miliseconds elapsed since the first call to requestAnimationFrame. If we keep storing the value of the timestamp for the prior frame, we can calculate the delta time:
Example:
const SPEED = 60; // pixels per second
var oldTimestamp = 0;

function render(timestamp) {
  var delta = (timestamp - oldTimestamp) / 1000.0;
  oldTimestamp = timestamp;

  // ...
  x = (x + SPEED * delta) % canvas.width;
  requestAnimationFrame(render);
}

You can try this online code snippet.
Some considerations on delta time to keep in mind:

An upper bound must always be set on the delta time value (e.g., 250ms) in order to prevent grlitches in the game logic. A big "skip" in delta time can cause collision errors, abnormal functioning in the physics engine, etc.

Sometimes it is recommendable to skip our game's update by a frame (for instance, as Phaser does).
